import React from "react";
import "../../css/itinerary.css";
import rearview from "../../images/rearview.JPG";

const Select = (props) => {
  return (
    <div className="day">
        <h2 className="day-header">Select your day from the side menu</h2>
        {/* <h3 className="day-subheader">Barcelona Art and City</h3> */}
        <hr className="day-header-line" />
        <img src={rearview} alt="Its us!" className="select-img" />
    </div>
  );
};

export default Select;
